(30, 'ACIA Premoldados Ltda', 'A ACIA Pré-moldados é uma empresa de industrialização de artefatos de cimento, ou seja, pré-moldados de concreto destinados à construção civil. Tudo começou em 1967, no Brasil, na cidade de Uberlândia, no estado de Minas Gerais, sendo uma das primeiras empresas montadas nesse ramo.\r\nObjetivo era a produção de placas de muro, mas com o tempo a companhia se adequou ao mercado com a busca de melhorias contínuas, do atendimento às necessidades dos clientes; por consequência, essas ações fizeram com que sua fabricação aumentasse para mais produtos.\r\n\r\nA missão da empresa é a busca em oferecer, aos consumidores de Uberlândia e região, produtos de qualidade, buscando a satisfação de seus clientes e oferecendo um melhor resultado na relação custo x benefício.', 'logo.jpg', 'aci premoldados.jpg', '', '', 'JURÍDICA', NULL, 'Período de avaliação', NULL, NULL, '', '2017-11-23 11:20:18', '2018-04-23', 1551, 8, NULL, 'Premoldados Acia LTDA', 'ACIA Premoldados', 'Renata Santos de Abreu', NULL, '026.168.773/0001-75', 'aciapremoldados@hotmail.com'),
