(98, 'Lamonier Materiais de Construção - São Jorge', 'A Lamonier Materiais de Construção foi fundada no ano de 2004. Foi a junção da experiência no mercado com o sonho empreendedor de seus sócios, João e Mirley. E com o passar dos anos a empresa foi crescendo tanto em espaço físico, quanto em reconhecimento por parte de seus clientes.  \r\nA Lamonier Materiais de Construção oferece aos seus freguês, uma completa gama de produtos, desde material básico até o mais fino acabamento para a sua obra.  Temos tijolos, areia, brita, cimento, impermeabilizantes, ferramentas, tintas, material hidráulico, material elétrico, telhas de fibrocimento, fibra, cerâmicas e de vidro, acessórios e outros. Aliamos a tradição dos produtos mais conhecidos no setor, com as novidades tecnológicas de produtos e ferramentas.  \r\nA Lamonier Materiais de Construção tem duas lojas: uma no bairro São Jorge e outra no bairro Santa Mônica. Temos profissionais qualificados e treinados para auxiliar os clientes, em busca das melhores soluções. Além disso, temos frota própria de caminhões. Dessa forma podemos agilizar o processo de entrega dos produtos para nossos clientes. ', 'logo.jpg', 'logo.jpg', '', '', '', NULL, 'Período de avaliação', NULL, NULL, '', '2018-01-17 10:31:10', '2018-06-17', 1618, 8, NULL, NULL, NULL, NULL, NULL, NULL, 'vendas@lamoniermateriais.com.br'),
