(102, 'DGD'' ENGENHARIA', '  A DGD'' Engenharia com experência e exelência em sua prestação  de  serviços,  vem atender   e   proporcionar   ao mercado  da  Construção Civil  todo  aparato executivo para \r\nque se inicie sua edificação.\r\n\r\n     Em suas parcerias com diversos profissionais do ramo, visa atender seus clientes com, menores preços, pontualidade em seus prazos, qualidade e precisão, contando com mão de obra qualificada para oferecer profissionalismo em todos os serviços oferecidos.', NULL, '26112455_2012971588944194_2413882949965001526_n.jpg', '', '', '', NULL, 'Período de avaliação', NULL, NULL, '', '2018-01-18 10:59:44', '2018-06-18', 1622, 8, '050.336.116-07', '', '', 'DANILO GABRIEL', 'DIRETOR', '', 'dgd.engenharia@hotmail.com'),
