(109, 'Souza Santana Acabamentos', 'Souza Santana está a 10 anos mercado executando obras que são referencia em qualidade. Executamos acabamentos porcelanato, pastilhado, granitos, pedras rusticas, tijolos rústicos e varias outros tipos de materiais.\r\nRealizamos reformas e obras residenciais e comerciais.', 'logo.jpg', 'logo.jpg', '', '', '', NULL, 'Período de avaliação', NULL, NULL, '', '2018-02-01 16:20:30', '2018-07-01', 1632, 8, '015.151.326-09', '', '', 'Pedro Souza', 'DIretor', '', ''),
(110, 'Verde Flora', 'A Verde Flora é uma empresa que atua há mais de 15 anos no ramo de paisagismo na cidade de Uberlândia e região. A empresa  trabalha com projetos de paisagismo, execução e manutenção de jardins, cascatas e espelhos d’água, assim como venda de plantas ornamentais, vasos e acessórios para jardim, propiciando aos seus clientes assistência de arquiteta paisagista e jardineiros experientes.\r\n\r\nA Verde Flora possui grande experiência em execução de jardins, tendo muitas obras executadas, sendo elas jardins de empresas, clínicas, condomínios residenciais e comerciais, edifícios, chácaras, fazendas, residências e ainda  execução de gramados em barragens de represas, como por exemplo a represa de Miranda, próximo à Uberlândia-MG, com mais de 100.000 m² de grama.  A empresa também tem várias parcerias com construtoras e profissionais da área da construção civil, como construtores, arquitetos, engenheiros e decoradores.', 'logo.jpg', 'logo.png', '', '', '', NULL, 'Período de avaliação', NULL, NULL, '', '2018-02-06 09:21:58', '2018-07-06', 1634, 8, '986.725.416-34', '', '', 'Denise', 'Proprietário ', '', 'denise@verdefloraudi.com.br'),
