(113, 'Madeiras Ypê - João Naves ', 'Somos uma empresa com mais de 30 anos atuação em todo o Estado de Minas Gerais com comercialização de produtos e serviços no setor madeireiro.\r\n\r\nObjetivando proporcionar aos nossos clientes a conquista de padrões cada vez melhor de produtividade, qualidade e competitividade, a MADEIRAS YPÊ aliou suas metas e seu plano de negocio à empresas possuidoras de tecnologia, a fim de agregar qualidade aos processos industriais dos nossos clientes.\r\n\r\nA efetivação dessa parceria tornou possível oferecermos aos nossos clientes, produtos de alta qualidade com custos competitivos, onde juntos, a MADEIRAS YPÊ garante a excelência na qualidade de seu atendimento e de seus produtos.', 'MadeiresypeCapa.png', 'MadeirasypeLogo.jpg', '', '', '', NULL, 'Período de avaliação', NULL, NULL, '', '2018-02-19 15:41:31', '2018-07-19', 1637, 8, '', 'Mcm madeiras eireli', 'Madeiras Ypê', 'Gonçalves ', 'Proprietário ', '23880267000205', 'gerencia@madeirasype.com.br'),
