(116, 'Protend Lajes e Painéis ', 'EMPRESA\r\n\r\nA Protend Industria de Pré-Fabricados atua no mercado disponibilizando aos clientes produtos em pré-fabricados como lajes e painéis treliçados com alta qualidade e acompanhamento técnico.\r\n\r\nAlém da experiência e qualidade a Protend oferece aos clientes soluções disponíveis no mercado de pré-fabricados. \r\n\r\nAtravés dos softwares específicos, cada laje é dimensionada em função de sua utilização e características próprias, produzindo material adequado para cada projeto.\r\n\r\nMateriais com controle tecnológico de qualidade.\r\n\r\nFornecemos projeto detalhado da montagem da laje, para facilitar a execução da obra.\r\n', 'LajeTrelicada.jpg', 'logo.jpg', '', '', '', NULL, 'Período de avaliação', NULL, NULL, '', '2018-02-20 09:20:32', '2018-07-20', 1639, 8, '', 'Protend indústria de pré fabricados eireli ', 'Protend', 'Marcos', 'Proprietário ', '07.392.518.0001-67', 'vendas@protend.com.br'),
