(120, 'Nacional Piso - João Naves ', 'A nacional Piso dedica-se ao mercado de material para construção desde 2 de outubro de 2000. Uma empresa diferenciada, onde o empreendedor e visionário Sr. Rosenval Rodrigues Costa consolidou a sua marca e conquistou a sua clientela, através do cuidado com seu cliente e investimento no seu material de acabamento, entre eles:piso, porcelanato, louças e metais. O sucesso também pode ser atribuído ao investimento em seus colaboradores. Acredita-se na capacidade humana de desenvolver habilidades e, portanto, investe-se em cursos de aprimoramento e palestras.', 'logo.jpg', 'logo.jpg', '', '', '', NULL, 'Período de avaliação', NULL, NULL, '', '2018-02-22 15:40:24', '2018-07-22', 1643, 8, '', 'Rc distribuidora e comercio eireli', 'Nacional Piso', 'Mariely ', 'Gerente', '17464745000457', 'marielypeixoto@hotmail.com'),
