(125, 'Curinga Pisos', 'Localizada em Uberlândia-MG, a Curinga Pisos é uma empresa de destaque no mercado de pisos e revestimentos, sendo especializada e exclusiva em pisos cerâmicos. Contando com os melhores parceiros, oferece a seus clientes uma linha completa de produtos de altíssima qualidade, com os mais diversos padrões de acabamento.\r\n\r\nSua equipe conta com profissionais qualificados e constantemente treinados, antenados para acompanhar todas as tendências do exigente mercado nacional, oferecendo sempre um atendimento profissional e soluções personalizadas para a sua necessidade.\r\n\r\nA linha de produtos da Curinga Pisos conta com uma grande variedade de Pisos, Louças, Metais, Porcelanatos, Churrasqueiras, etc., oferecendo, além da beleza, sofisticação e qualidade para sua obra. Venha conferir!\r\n\r\nFaça um orçamento sem compromisso!', 'logo.jpg', 'logo.jpg', '', '', '', NULL, 'Período de avaliação', NULL, NULL, '', '2018-02-26 16:55:14', '2018-07-26', 1647, 8, '', 'Universal pisos e revestimentos ', 'Curinga Pisos', 'Thiago', 'Proprietário ', '20460845000177', 'thiago@curingapisos.com.br'),
(126, 'Aquarela Tintas - João Naves ', 'Aquarela Tintas começou sua história em 1993 com uma loja em Vargem Grande do Sul – SP. Iniciou suas atividades vendendo tinta automotiva e imobiliária. \r\nEm 1998, depois de 5 anos de sucesso, os sócios tomaram uma importante decisão juntamente com a Suvinil: montar sua primeira loja fora da cidade. \r\n\r\nAssim, um dos sócios foi para a cidade de Mogi Guaçu, estabelecendo a matriz das lojas. Com sua visão de empreendedor, abriu mais 18 lojas no período de 1998 até 2012 no estado de São Paulo e, em 2010, expandiu seus negócios para os estados de Minas Gerais e Goiás, onde tem 5 lojas na cidade de Uberlândia, 1 em Araguari e 1 em Anápolis.\r\n\r\nAtualmente, a empresa é conhecida como “Grupo Aquarela Tintas” contando com 25 lojas.', 'logo.jpg', 'logo.png', '', '', '', NULL, 'Período de avaliação', NULL, NULL, '', '2018-02-27 10:04:21', '2018-07-27', 1648, 8, '', 'Aquarela Guaçu comercio de tintas ltda', 'Aquarela Tintas - João Naves ', 'Patrícia ', 'Gerente', '02505043002955', 'cx.uberlandia@grupoaquarelatintas.com.br'),
