(133, 'Ampéres Engenharia Elétrica', 'Empresa prestadora de serviços nas áreas de:\r\n\r\n-Eficiência Energética:\r\n\r\n> Adequação do Contrato de Fornecimento de Energia;\r\n> Estudo de Viabilidade Técnica e Econômica para instalação de Geradores Diesel, Placas Fotovoltaicas e Bancos de capacitores;\r\n>Analise da Qualidade de Energia;\r\n\r\n-Elaboração de Projetos:\r\n\r\n>Projetos de Quadros Elétricos;\r\n>Projetos de Subestações Elétricas;\r\n>Projetos de Seletividade;\r\n>Projetos de aterramento e SPDA;\r\n>Projetos de instalações e montagens elétricas;\r\n>Projetos de iluminação e tomadas;\r\n>Projetos de redes de distribuição;\r\n>Levantamento e atualização dos diagramas unifilares;\r\n\r\n-Fornecimento de Mão de Obra Especializada:\r\n\r\n>Instalações;\r\n>Montagens;\r\n>Manutenção;\r\n\r\n-Consultoria Especializada:\r\n\r\n> Auditoria em instalações elétricas de acordo com as normas vigentes (NR-10, NR-12, NBR 5410);\r\n> Implantação e verificação do prontuário do sistema elétrico em atendimento aos requisitos da NR-10;\r\n> Inspeções e Laudos Técnicos das Instalações Elétricas (SPDA, Medição da Resistência da Malha de Aterramento, Medição da isolação elétrica dos equipamentos);', 'logo.jpg', 'logo.jpg', '', '', '', NULL, 'Período de avaliação', NULL, NULL, '', '2018-03-01 16:49:28', '2018-08-01', 1655, 8, '', 'F&r engenharia elétrica ltda', 'Amperes engenharia ', 'Rodrigo ', 'Proprietário ', '24204973000100', 'contato@amperesengenharia.com'),
(134, 'Premoltec', 'Premoldados PREMOLTEC atua desde 1981 no mercado de Lajes Premoldadas, tendo sido pioneira na utilização da tecnologia de lajes treliçadas e fabricação de blocos de concreto para vedação e estrutural na cidade de Uberlândia e região.\r\nEmpregando sempre a melhor matéria prima na fabricação de seus produtos a PREMOLTEC conta com parceiros altamente selecionados e de renome tais como Gerdau, Acelor, Lafarge, Holcim, entre outros.\r\nAtendendo às necessidades técnicas diversas desde pequenas obras residenciais às grandes obras comerciais e industriais a PREMOLTEC fabrica lajes de acordo com cada projeto técnico visando otimizar a execução das obras, proporcionando maior segurança e economia.\r\nDesta forma a PREMOLTEC vem conquistando a simpatia de seus clientes, fornecedores e amigos que confiam em seu trabalho diferenciado e específico na certeza do melhor investimento. \r\n\r\n', 'LajeTrelicada-20140506114550.jpg', 'logo.png', '', '', '', NULL, 'Período de avaliação', NULL, NULL, '', '2018-03-02 08:39:48', '2018-08-02', 1654, 8, '051.623.456-01', '', '', 'Guilherme', 'Gerente', '', 'premoltecc@hotmail.com'),
