(143, 'Center Pedras', 'Desde 1998, a Center Pedras vem trabalhando com esforço e dedicação para melhor atende-los. Em parceria com renomadas construtoras, arquitetos, decoradores e você, cliente Center Pedras, tentando sempre mantê-los atualizados e prestar-lhes serviços de qualidade em Uberlândia e região.\r\nVerifique nossos produtos e confira. Faça-nos uma visita... porque:\r\nSeriedade e respeito a seus clientes;\r\nMão de obra especializada e de confiança;\r\nPreço justo e condições particulares de pagamento;\r\nMaterial do mais simples ao mais sofisticado, priorizando o gosto do cliente;\r\nPreocupação com a pontualidade em sua obra.\r\nSão condições que a empresa também valoriza para mantermos essa parceria há alguns anos. OBRIGADA CLIENTE CENTER PEDRAS.', 'logo.jpg', 'logo.jpg', '', '', '', NULL, 'Período de avaliação', NULL, NULL, '', '2018-03-07 16:47:25', '2018-08-07', 1662, 8, '', 'Rosana Gonçalves Jorge Silva me', 'Center pedras', 'Rosana', 'Proprietário ', '02736038000152', 'contato@centerpedras.com.br'),
(144, 'Nacional Piso - Floriano Peixoto ', 'A nacional Piso dedica-se ao mercado de material para construção desde 2 de outubro de 2000. Uma empresa diferenciada, onde o empreendedor e visionário Sr. Rosenval Rodrigues Costa consolidou a sua marca e conquistou a sua clientela, através do cuidado com seu cliente e investimento no seu material de acabamento, entre eles:piso, porcelanato, louças e metais. O sucesso também pode ser atribuído ao investimento em seus colaboradores. Acredita-se na capacidade humana de desenvolver habilidades e, portanto, investe-se em cursos de aprimoramento e palestras.', 'logo.jpg', 'logo.jpg', '', '', '', NULL, 'Período de avaliação', NULL, NULL, '', '2018-03-08 10:39:27', '2018-08-08', 1663, 8, '', 'Rc distribuidora e comercio eireli', 'Nacional Piso', 'Wexley', 'Gerente', '17464745000538', 'nacional.umuarama@hotmail.com'),
