(176, 'MS Marcenaria', 'A M&S Móveis Planejados atua no mercado de móveis sob medida de alto padrão na cidade de Uberlândia em Minas Gerais desde 1999 e acumula grande experiência na produção de mobiliário planejado, desenvolvendo soluções diferenciadas de acordo com a necessidade de cada cliente. Nossa linha de móveis planejados destaca-se pela qualidade, utilizando apenas o que há de melhor nos materiais disponíveis no mercado nacional e internacional. São móveis sob medida para cozinhas, dormitórios, closets, salas, banheiros, áreas de serviço e escritórios.\r\nNossa missão\r\nFabricar móveis com elevado nível de qualidade e durabilidade, entregues no prazo certo e com preço justo.\r\nA M&S Marcenaria possui diferenciais que constituem a identidade da empresa e qualificam seus produtos e serviços agregando valor à sua marca. Confira a seguir esses diferenciais e entenda o porquê de escolher a M&S Marcenaria para desenvolver o seu projeto.', 'logo.jpg', 'logo.jpg', '', '', '', NULL, 'Período de avaliação', NULL, NULL, '', '2018-03-22 14:54:42', '2018-08-22', 1688, 8, '', 'Ms marcenaria ltda', 'Ms marcenaria ', 'Fernando ', 'Proprietário ', '09632679000106', 'contato@msmarcenaria.com'),
