(185, 'Bom Jesus', 'Seja bem vindo ao Grupo Bom Jesus. Além da Bom Jesus Extração Mineral Ltda, uma empresa líder e moderna, o grupo Bom Jesus é composto por um conjunto de organizações, com capacidade para atendê-lo com eficiência, qualidade e agilidade, a um custo altamente competitivo, com a credibilidade de quem atua há mais de 47 anos. \r\n\r\nPossuímos uma marca reconhecida, pelo seu trabalho sério, caracterizado por um conjunto de ações de valorização de seus clientes e de todos os profissionais que, de modo direto ou indireto, contribuem para um somatório de resultados positivos numa organização sempre atenta à sua responsabilidade com o meio ambiente. \r\n\r\nA comercialização de material básico para construção, composto por areia, brita e terra, serviços de aterro e desaterro de áreas, limpeza de terrenos, fabricação da massa Argabom para assentar e rebocar tijolos, caçambas tira-entulho e reciclagem de resíduos sólidos da construção caracterizam alguns de nossos produtos. \r\nPara melhor atendê-lo, contamos com um serviço logístico que nos possibilita uma entrega rápida e eficiente.\r\nVisite a nossa empresa para nos tornarmos cada dia mais: Grandes Parceiros! ', 'logo.png', 'logo.png', '', '', '', NULL, 'Período de avaliação', NULL, NULL, '', '2018-03-29 10:03:15', '2018-08-29', 1695, 8, '', 'Bom jesus locação de caçambas ltda ', 'Bom Jesus', 'Gledson', 'Gerente', '05389137000101', 'gledson@grupobomjesus.com.br'),
