(192, 'Zapi Impermeabilizantes - Santa Mônica ', 'Zapi Impermeabilizantes foi fundada em 1993, pelo Eng° civil Roberto Moraes de Rezende (CREA 28.701-1), com grande experiência no setor de impermeabilização.\r\nHoje é considerada umas das principais empresas do ramo no interior do Brasil.\r\nDepartamento comercial possui o maior estoque da região, com uma diversificada linha de materiais capazes de eliminar todos os problemas relacionados a vazamentos, infiltrações, umidades e trincas.\r\nO departamento de obras dispõe de engenheiros e técnicos em construção civil, oferecendo os seguintes serviços: Injeção de poliuretano; Aplicação de mantas asfálticas, mantas líquidas, argamassas poliméricas e cristalizantes; Recuperação de estruturas de concreto; Tratamento de juntas de dilatação.\r\n\r\nCompromisso, qualidade e responsabilidade estão presentes em cada negócio realizado com nossos clientes.', 'logo.png', 'logo.jpg', '', '', '', NULL, 'Período de avaliação', NULL, NULL, '', '2018-04-05 09:18:36', '2018-09-05', 1702, 8, '', 'Zapi distribuidora ltda', 'Zapi Impermeabilizantes ', 'Alexandre ', 'Proprietário ', '71222889000108', 'alexandre@drzapi.com.br'),
