(194, 'Ecomulti - Locação de Caçambas ', 'Empresa referência no ramo de Locação de Caçambas para entulho e comércio de britas.\r\nContamos com um ótimo atendimento, excelente localização, preço justo e profissionais capacitados para melhor atender você e sua obra.\r\nTemos como compromisso garantir sempre a satisfação e segurança de nossos clientes, por isso trabalhamos com caçambas novas e de alta qualidade.\r\nEcomulti é sinonimo de profissionalismo e comprometimento. Compare e confirme.', 'logo.jpeg', 'logo.jpeg', '', '', '', NULL, 'Período de avaliação', NULL, NULL, '', '2018-04-05 09:36:23', '2018-09-05', 1702, 8, '', 'Ecomulti comercio e serviços ltda ', 'Ecomulti', 'Alexandre ', 'Proprietário ', '21356883000147', 'atendimento@ecomulti.com.br'),
(195, 'Aquarela Tintas - Alípio Abrão ', 'Aquarela Tintas começou sua história em 1993 com uma loja em Vargem Grande do Sul – SP. Iniciou suas atividades vendendo tinta automotiva e imobiliária. \r\nEm 1998, depois de 5 anos de sucesso, os sócios tomaram uma importante decisão juntamente com a Suvinil: montar sua primeira loja fora da cidade. \r\n\r\nAssim, um dos sócios foi para a cidade de Mogi Guaçu, estabelecendo a matriz das lojas. Com sua visão de empreendedor, abriu mais 18 lojas no período de 1998 até 2012 no estado de São Paulo e, em 2010, expandiu seus negócios para os estados de Minas Gerais e Goiás, onde tem 5 lojas na cidade de Uberlândia, 1 em Araguari e 1 em Anápolis.\r\n\r\nAtualmente, a empresa é conhecida como “Grupo Aquarela Tintas” contando com 25 lojas.', 'logo.jpg', 'logo.png', '', '', '', NULL, 'Período de avaliação', NULL, NULL, '', '2018-04-05 11:03:40', '2018-09-05', 1703, 8, '', 'Aquarela minas comercio de tintas ltda ', 'Aquarela Tintas - Alípio Abrão ', 'Elton', 'Gerente', '11223528000227', 'ger.uberlandia2@grupoaquarelatintas.com.br'),
