(197, 'FERRAPRO - Ferramentas e Serviços ', 'A Ferrapro conta com uma equipe de técnicos capacitados e treinados diretamente nas fábricas e um centro técnico modelo para oferecer um serviço de alto padrão e agilidade. Os serviços de reparo e manutenção são realizados com o compromisso de 100% de garantia do trabalho realizado.\r\nNossa Assistência Técnica é especializada nas melhores marcas disponíveis no mercado: Bosch, Dewalt, Skil, Black Decker, Dremel, Stanley.', 'logo.png', 'logo.png', '', '', '', NULL, 'Período de avaliação', NULL, NULL, '', '2018-04-06 16:24:22', '2018-09-06', 1705, 8, '', 'Ferrapro ferramentas e serviços ', 'Ferrapro', 'Ulisses ', 'Proprietário ', '19953038000107', 'contato@ferrapro.com.br'),
