(199, 'Ferramac', 'Atuando no mercado com experiência e agilidade a Ferramac Ferramentas e Equipamentos de Segurança é uma empresa, sólida no comércio de Máquinas, Ferramentas, Abrasivos, EPI’s Solda e Corte. Desde 2010 se destaca no contexto empresarial por seu variado e completo estoque, atendimento personalizado e condições comerciais de modo a sempre facilitar o bom relacionamento com seus parceiros. Desde sua fundação a Ferramac Ferramentas pauta sua atuação em princípio éticos, buscando cumprir sempre as obrigações que nos são responsáveis.', 'logo.png', 'logo.png', '', '', '', NULL, 'Período de avaliação', NULL, NULL, '', '2018-04-11 11:08:20', '2018-09-11', 1707, 8, '', 'Ferramac ferramentas e equipamentos de segurança ltda ', 'Ferramac', 'Lucas ', 'Proprietário ', '11685924000195', 'ferramac@ferramac.com.br'),
