(206, 'Paula Decorações ', 'No mercado desde 1978 a Paula Decorações é referência no ramo de decorações de interiores em Uberlândia e região. Trabalhamos com produtos sob medida para cada cliente, temos nossa fábrica própria de cortinas e somos representantes oficiais de marcas renomadas no cenário nacional. Assim, compõe nosso leque de produtos comercializados:\r\n\r\n·	Cortinas Exclusivas e Sob Medida\r\n\r\n·	Persianas e Toldos Manuais e motorizados\r\n\r\n·	Papéis de Parede Exclusivos Nacionais e Importados\r\n\r\n·	Tapetes Personalizados\r\n\r\n·	Pisos Laminados e Vinílico.\r\n\r\nBuscamos encantar nossos clientes transformando o ambiente dos sonhos em realidade. Nosso intuito é atender sua necessidade, diferenciando seu ambiente com beleza, conforto, exclusividade e sofisticação. Personalizamos para fazer de cada espaço o “seu lugar”, traduzindo seu estilo e refletindo sua identidade. Para nós, design é levado a sério, porque acreditamos que pode agregar valor ao seu espaço. Assim, somos comprometidos em satisfazer nossos clientes, e para isso, estamos em constante desenvolvimento para trazer sempre qualidade e inovação em nossos produtos e serviços.\r\nNosso espaço está ainda mais aconchegante com ambiente climatizado, moderno e com estacionamento próprio para melhor atender aos nossos clientes e parceiros, contando com um completo e exclusivo showroom, para facilitar na escolha do produto ideal.\r\nAguardamos sua visita! Atendemos a toda a região do triângulo mineiro, entre em contato conosco!', 'logo.jpg', 'logo.png', '', '', '', NULL, 'Período de avaliação', NULL, NULL, '', '2018-04-17 17:13:04', '2018-09-17', 1729, 8, '', 'A alto astral cortinas e decorações ltda', 'Paula Decorações ', 'Maria Paula', 'Proprietário ', '05785838000151', 'comercial@pauladecoracoes.com.br');
