(209, 'A Tacominas', 'A Tacominas – Madeiras e Ferragens – existe há 35 anos. Em seu portifólio oferece mercadorias para todas as etapas da construção.\r\n\r\nA  grande variedade de produtos das melhores marcas, garante a qualidade dos itens comercializados.\r\nA marcenaria torna possível a fabricação de peças sob medida e de acordo com a preferência do cliente.\r\nOs amplos depósitos mantêm a qualidade dos produtos e permitem a pronta entrega das mercadorias o que agiliza o término da obra.\r\nVeja todo nosso site e comprove a tradição de nossa empresa.', 'logo.jpg', 'logo.png', '', '', '', NULL, 'Período de avaliação', NULL, NULL, '', '2018-04-18 11:13:14', '2018-09-18', 1732, 8, '', 'Marco Aurélio Matos ', 'A Tacominas ', 'Marco Aurélio Matos Júnior ', 'Proprietário ', '38719753000124', 'atacominas@terra.com.br'),
