(214, 'Alumilândia', 'Desde 1995 a Alumilândia vêm realizando um trabalho diferenciado no atendimento às construtoras, vidraçarias e serralherias de todos os portes.Tendo como parceiras empresas de renome buscamos os melhores e mais diversos produtos visando sempre proporcionar o menor custo possível sem abrir mão da mais alta qualidade.\r\nA cada dia a Alumilândia fortalece seu nome pelo trabalho diferenciado que realiza, desejando somente que você  possa ter a tranquilidade de ter realizado o melhor negócio.\r\n\r\n', 'logo.jpg', 'logo.jpg', '', '', '', NULL, 'Período de avaliação', NULL, NULL, '', '2018-04-20 11:49:23', '2018-09-20', 1736, 8, '', 'Alumilandia comercio de chapas e alumínio ltda ', 'Alumilandia', 'Eurípedes ', 'Proprietário ', '00892525000189', 'marcio@alumilandia.com'),
(215, 'Ipabrac ', 'Em 1964, nascia em Uberlândia, a primeira fábrica de parafusos do interior de Minas Gerais, com o nome de Indústria de Parafusos Brasil Central - IPABRAC.\r\nApós 11 anos de crescente produção e total liderança na região, sentindo a necessidade de diversifica'' r partiu também para a distribuição de uma variada gama de produtos no setor metalúrgico.\r\nCom preços altamente competitivos, produtos de qualidade garantida e atendimento personalizado, tornou-se hoje uma das maiores distribuidoras de Parafusos, Ferragens e Ferramentas do Brasil Central. São milhares de itens entregues a seus inúmeros clientes espalhados por vários estados da federação.\r\nAcompanhando sempre as necessidades de atualização, desenvolveu e implantou modernos sistemas de telefonia e informática, treinamento e orientação a seus profissionais, visando exclusivamente a qualidade no atendimento ao cliente.', 'logo.jpg', 'logo.jpg', '', '', '', NULL, 'Período de avaliação', NULL, NULL, '', '2018-04-20 15:22:50', '2018-09-20', 1737, 8, '', 'Ipabrac Ltda ', 'Ipabrac', 'Alexandre ', 'Proprietário ', '25631151000179', 'vendas@ipabrac.com.br'),
