(226, 'Cosac', 'Seja bem vindo a Cosac, somos uma empresa  sólida e moderna há mais de 32 anos no mercado de materiais para construção em Uberlândia e região, com honestidade e transparência. A Cosac é composta por um grande conjunto de organizações, com capacidade para atendê-lo com eficiência, qualidade e agilidade a um custo satisfatório e competitivo.\r\nPossuímos uma marca reconhecida pelo trabalho sério, adquirido durante vários anos, caracterizado por um conjunto de ações e valorização de seus clientes. A comercialização de material básico para construção é composta por areia, brita, cascalho de campo ( sendo duas jazidas licenciadas ) e terra, além destes, oferecemos os serviços de terraplenagem e locação de máquinas. Para melhor atendê-lo, contamos com um serviço logístico que nos possibilita uma entrega rápida, eficiente e segura.\r\nAguardamos sua visita a nossa empresa para nos tornarmos cada dia mais próximos e sermos grandes parceiros em seus empreendimentos.', '20180502_103425.png', '20180502_105803.jpg', '', '', '', NULL, 'Período de avaliação', NULL, NULL, '', '2018-05-02 10:24:05', '2018-10-02', 1746, 8, '', 'Porto de areia cosac comercio de materiais de construcao ltda', 'Cosac', 'Carlos filho', 'Proprietário ', '02167644000102', 'contato@cosacconstrucao.com.br'),
