(228, 'Espaço Telhas Rondon ', 'Alguns anos no mercado trazendo excelência e soluções para o seu telhado. Para isso, qualidade e compromisso são essenciais em nosso dia-a-dia, visando um atendimento com pontualidade, responsabilidade e transparência perante o nosso cliente, buscando sempre a credibilidade e satisfação dos nossos parceiros e fornecedores. Solicite a visita de um especialista em telhados e tire suas dúvidas, produtos certificados e reconhecidos no mercado da construção civil. Visite nosso show room e conheça nossos produtos!', '15800496_1210662772345015_4952521464652867157_o.jpg', 'logo.jpg', '', '', '', NULL, 'Período de avaliação', NULL, NULL, '', '2018-05-04 12:39:53', '2018-10-04', 1748, 8, '', 'Roque santos representações ltda', 'Espaço Telhas Rondon', 'Thiago', 'Proprietário ', '17857235000105', 'thiagoroque@espacotelhasrondon.com'),
(229, 'Cia Luz ', 'A Cia Luz Iluminação foi fundada em 2010 com a proposta de inovar o mercado de iluminação em Ribeirão Preto e região. A partir de então só cresceu e conquistou os clientes pelo excelente atendimento, variedade de produtos e os melhores preços do mercado.\r\n\r\nCom uma equipe muito bem alinhada e antenada com as novidades do mundo da iluminação decorativa, a Cia Luz conta com projetistas e vendedores a disposição para auxiliar os profissionais, arquitetos e decoradores, além de assessorar os clientes que buscam ideias para transformar algum espaço específico.\r\n\r\nO mix de produtos da loja é bem variado, além de itens básicos como lâmpadas e spots, há uma gama de lustres de cristais, pendentes e luminárias com o design moderno.\r\n\r\nA nova loja é ampla e possui estacionamento próprio com manobrista. Uma das novidades é o laboratório para apresentações dos projetos com todo o conforto e elegância que a Cia Luz Iluminação é reconhecida.', '20180504_175219.jpg', 'logo.jpg', '', '', '', NULL, 'Período de avaliação', NULL, NULL, '', '2018-05-04 17:36:57', '2018-10-04', 1749, 8, '', 'Cia luz ltda', 'Cia Luz', 'Marcos Furco', 'Proprietário ', '13176708000220', 'contato@cialuz.com.br'),
(230, 'Seap Eucalipto Tratado', 'A SEAP foi fundada em outubro de 1971 na cidade de Uberlândia / MG – Brasil. Iniciamos nossas atividades tendo como foco a produção de florestas plantadas de eucalipto, um recurso renovável.\r\nNosso processo de diversificação de produtos se intensificou a partir do ano de 2000 quando foi implantado através de Pesquisa & Desenvolvimento, a UPM –USINA DE PRESERVAÇÃO DE MADEIRA, um moderno processo de tratamento de madeira autoclavado.\r\nEm mais de 40 anos de existência, ampliamos nossa oferta de produtos, estabelecemos nossa tradição e ganhamos reconhecimento do mercado brasileirao.', 'logo.jpg', 'logo.png', '', '', '', NULL, 'Período de avaliação', NULL, NULL, '', '2018-05-08 14:35:06', '2018-10-08', 1750, 8, '', 'Seap reflorestamento eireli epp', 'Seap Eucalipto Tratado', 'Lucas ', 'Gerente', '09178135000116', 'seap@seap.com.br'),
