(233, 'ACM & Esquadrias Triângulo ', 'Um dos principais diferenciais de mercado da ACM TRIANGULO é a excelência no atendimento. Os profissionais de todos os setores da empresa recebem treinamentos internos semestrais, participam de palestras, feiras e outras atividades de capacitação profissional.\r\n\r\nFocada em qualidade a ACM TRIANGULO prima em trabalhar sempre com os melhores fornecedores do mercado nacional e internacional. Com inúmeras obras realizadas conquistou conceituado nome e grande valor agregado à marca, tornando-se sinônimo em alumínio composto (ACM).\r\n\r\nContando com equipamentos de primeira linha e amplo espaço, oferece a seus clientes o melhor em: chapas, peças, portas, portões, revestimentos, painéis, fachadas e corte/usinagem de chapas em ACM.', 'logo.png', 'logo.png', '', '', '', NULL, 'Período de avaliação', NULL, NULL, '', '2018-05-09 17:07:55', '2018-10-09', 1753, 8, '', 'Oliveira e Magalhães materiais para construção ltda', 'Acm e esquadrias ', 'Júlio ', 'Gerente', '11393390000476', 'jcccaixeta@gmail.com'),
