(238, 'Agiplast', 'Desde 15/07/2010, o grupo AGIPLAST com a sua matriz em Catalão-GO (Forros Catalão Indústria e Comércio Ltda - ME), distribui a mais completa linha de divisórias, forros, portas sanfonadas, tubos e conexões, perfis de alumínio, metalon galvanizado, vidros para divisórias, metais sanitários, torneiras e acessórios.\r\n\r\nAtendendo sempre os requisitos de qualidade, o grupo AGIPLAST selecionou os melhores produtos dos mais conceituados fabricantes: Diviforma, Eucatex, Noroaço, Coferpol, New Fix, Multi Fix, Vitral, Astra, Krona, Amanco, Tigre e Vouga são algumas destas empresas conceituadas que confiaram há muito no trabalho sério que realiza.\r\nAssim buscamos crescer a cada instante, na certeza de oferecer um melhor atendimento a todos os revendedores, parceiros e amigos que completam o sucesso de nosso trabalho.\r\n', 'logo.jpg', 'logo.jpg', '', '', '', NULL, 'Período de avaliação', NULL, NULL, '', '2018-05-15 10:52:22', '2018-10-15', 1758, 8, '', 'Forros catalão indústria e comércio eireli', 'Agisplat', 'Admilson ', 'Proprietário ', '12274325000222', 'comercial@agiplat.net'),
(239, 'Madforte Madeiras', 'Uma empresa solidificada pelo compromisso com a sustentabilidade de nosso planeta, nossa casa e a casa de nossos filhos, netos e gerações futuras. Por isso, a excelência é nosso norte ao que se refere na aquisição de matérias primas. Priorizamos os conceitos de conservação e remanejo nas florestas, para que sua madeira faça parte do processo legal de extração. A Madforte Madeiras entende que o requinte das madeiras de lei, só é prazeroso aliado aos critérios instituidos pelos orgãos de conservação do meio ambiente, dessa forma, se aperfeiçoando a cada dia para uma plena atividade, gerando além de produtos de ótima qualidade, satisfação e alegria.\r\n\r\nSeja bem vindo, é um prazer te conhecer!    ', 'logo.jpg', 'logo.jpg', '', '', '', NULL, 'Período de avaliação', NULL, NULL, '', '2018-05-15 12:22:08', '2018-10-15', 1759, 8, '', 'Madforte madeiras ltda', 'Madforte', 'Ademir', 'Gerente', '08282929000162', 'ademir@madfortemadeiras.com'),
(240, 'União Tintas - Martins', 'A União Tintas é uma empresa que atua nos segmentos automotivo e imobiliário do comércio varejista de tintas. Foi fundada em 1986 com sede na cidade de Araguari, onde até hoje está consolidada a matriz, e através dos anos foi se tornando uma empresa de tradição e sinônimo de confiança para seus clientes, funcionários e fornecedores. Hoje conta com atuação nas cidade de Uberlândia e Araguari.\r\n\r\nPara se manter em um mercado onde a concorrência é crescente e existem várias oscilações a União Tintas procura se destacar em vários fatores atendimento, estabelecimento de parcerias, qualidade dos produtos, sempre buscando uma maior satisfação de seus clientes.', 'logo.jpg', 'logo.jpg', '', '', '', NULL, 'Período de avaliação', NULL, NULL, '', '2018-05-16 16:25:32', '2018-10-16', 1760, 8, '', 'Auto tintas uniao ltda', 'União Tintas ', 'Danilo', 'Proprietário ', '21924295000324', 'contato@uniaotintas.com.br'),
(241, 'Açosul Ferro e Aço ', 'A AÇOSUL FERRO E AÇO que atua há mais de 20 anos no sul do país e há 07 anos em Uberlândia e região, foi criada à partir da ampla experiência de seus sócios no mercado de ferro e aço, com apoio e parceria da GERDAU S/A, líder de mercado no segmento pela excelência e qualidade de seus produtos.\r\n\r\n \r\n\r\nAtravés de uma logística rápida e eficiente, a AÇOSUL FERRO E AÇO disponibiliza seus produtos à pronta entrega, visa atender com atenção e cordialidade, contando com uma equipe de vendas qualificada e focada na execução do projeto de seus clientes, sempre com o melhor preço aliado a qualidade e agilidade na entrega!\r\n\r\n A AÇOSUL FERRO E AÇO busca construir parcerias fortes e duradouras, sempre aberta a negociações, comercializa não só o produto, mas uma experiência completa, que vai do atendimento à entrega dos produtos e serviços.', 'logo.jpg', 'logo.jpg', NULL, NULL, NULL, NULL, 'Período de avaliação', NULL, NULL, NULL, '2018-05-17 10:32:35', NULL, 1761, 8, NULL, NULL, NULL, NULL, NULL, NULL, 'acosul@acosul.com.br'),
