(245, 'Perfilados Uberlândia ', 'A Perfilados Uberlândia é uma empresa que atua há cinco anos\r\nno mercado nacional, com produtos de alta qualidade e uma \r\npolítica definida e competitiva. Procuramos trabalhar com \r\nos melhores fornecedores que se tem no mercado e buscando\r\n ao máximo a competitividade em preços de produtos.\r\n\r\nQueremos atendê-lo da melhor forma possível, em preços e\r\nprodutos de alta qualidade.', 'logo.jpeg', 'logo.jpg', NULL, NULL, NULL, NULL, 'Período de avaliação', NULL, NULL, NULL, '2018-05-22 15:59:20', NULL, 1763, 8, NULL, NULL, NULL, NULL, NULL, NULL, 'Alfredo@perfiladosuberlandia.com'),
(246, 'Colibri Materiais para Construção ', '  Consolidada no mercado Uberlandense a mais de 15 anos e oferecendo sempre os produtos de melhor qualidade disponíveis no mercado, a Colibri Construção & Cia é referência em materiais para construção do básico ao acabamento.\r\nSituada em uma região central e privilegiada, disponibilizamos um atendimento rápido e diferenciado a você cliente, que busca sempre excelência em serviços', NULL, 'logo.jpeg', NULL, NULL, NULL, NULL, 'Período de avaliação', NULL, NULL, NULL, '2018-05-23 09:45:35', NULL, 1764, 8, NULL, NULL, NULL, NULL, NULL, NULL, 'colibrimateriais@gmail.com '),
(247, 'Aquarela Tintas - Floriano Peixoto ', 'Aquarela Tintas começou sua história em 1993 com uma loja em Vargem Grande do Sul – SP. Iniciou suas atividades vendendo tinta automotiva e imobiliária. \r\nEm 1998, depois de 5 anos de sucesso, os sócios tomaram uma importante decisão juntamente com a Suvinil: montar sua primeira loja fora da cidade. \r\n\r\nAssim, um dos sócios foi para a cidade de Mogi Guaçu, estabelecendo a matriz das lojas. Com sua visão de empreendedor, abriu mais 18 lojas no período de 1998 até 2012 no estado de São Paulo e, em 2010, expandiu seus negócios para os estados de Minas Gerais e Goiás, onde tem 5 lojas na cidade de Uberlândia, 1 em Araguari e 1 em Anápolis.\r\n\r\nAtualmente, a empresa é conhecida como “Grupo Aquarela Tintas” contando com 25 lojas.\r\n', 'logo.png', 'logo.png', NULL, NULL, NULL, NULL, 'Período de avaliação', NULL, NULL, NULL, '2018-05-23 11:15:38', NULL, 1765, 8, NULL, NULL, NULL, NULL, NULL, NULL, 'Ger.uberlandia5@grupoaquarelatintas.com.br '),
