(253, 'Arte e Ofício Vidraçaria ', 'Fundada em 2004, Arte e Ofício é uma empresa conceituada e responsável no segmento de diversos produtos derivados de vidro, desde temperados, box para banheiros, espelhos entre outros, atendendo Uberlândia e região.\r\nConta com uma equipe de profissionais bem treinados, que são aptos a atender nossos clientes da melhor forma possível, a partir do primeiro contato até a entrega de nossos produtos. \r\nQualidade no serviço, prazo de entrega e satisfação dos nossos clientes que nos impulsionam ao crescimento e sucesso desde a nossa fundação.', 'logo.png', 'logo.png', NULL, NULL, NULL, NULL, 'Período de avaliação', NULL, NULL, NULL, '2018-05-24 11:47:26', NULL, 1767, 8, NULL, NULL, NULL, NULL, NULL, NULL, 'Vendas3@arteeoficio.com.br'),
(254, 'Haza Blocos - Marta Helena ', 'A HAZA representa a melhor alternativa para sua construção, oferecendo blocos de alvenaria estrutural, blocos de alvenaria para vedação e pisos de concreto a custos mais competitivos.\r\n\r\nCom uma estrutura diferenciada e grande capacidade de distribuição, a HAZA atende a todo tipo de mercado: de pequenas a grandes empresas. Nossos profissionais especializados estão prontos para oferecer a solução específica para seu negócio.\r\n\r\nTendo como foco a qualidade e satisfação de nossos clientes, criamos parceiros duradouros e relacionamento transparente, consolidando nosso compromisso e possibilitando seu sucesso e sua confiança.\r\n\r\nMarque uma visita sem compromisso e traga o seu projeto de construção, arquitetura ou paisagismo. Será um prazer atendê-lo. Nossa equipe técnica está pronta para oferecer todo o suporte e orientação necessária.', 'logo.jpg', 'logo.jpg', NULL, NULL, NULL, NULL, 'Período de avaliação', NULL, NULL, NULL, '2018-05-24 22:33:55', NULL, 1654, 8, NULL, NULL, NULL, NULL, NULL, NULL, 'Hazablocos@gmail.com'),
