(256, 'Turbo Tintas - Santa Mônica ', 'A empresa Turbo Tintas atua no mercado há mais de 15 anos no segmento de tintas imobiliárias e acessórios para pintura.\r\nNosso principal diferencial é unir atendimento qualificado, preços competitivos, agilidade no fornecimento e alta variedade de produtos de qualidade.\r\n\r\nA Turbo Tintas está comprometida a usar seu conhecimento e experiência para auxiliar seus clientes a alcançar o sucesso desejado por meio das principais tendências e inovações do mercado.', 'logo.png', 'logo.png', NULL, NULL, NULL, NULL, 'Período de avaliação', NULL, NULL, NULL, '2018-05-27 20:39:18', NULL, 1680, 8, NULL, NULL, NULL, NULL, NULL, NULL, 'Contato@turbotintas.com.br'),
