(260, 'Real Ladrilhos', 'Real Ladrilhos, empresa fundada em 22/08/2006, por seu atual propietário, Renato Marinho de Oliveira, tem como premissa maior a busca da satisfação de seus clientes quando da aquisição de produtos por ela fabricados. Atualmente a Real Ladrilhos encontra-se instalada à Av. Cleantro Vieira Goncalves, 1.500 - B. Jardim America, Uberlândia - MG, Telefones: (34) 3255-1001 / 9911-3519 e registrada na Junta Comercial de Minas Gerais sob a Insc Estadual 001.0164.9400-65 e na Receita Federal através do C.N.P.J. 08.263.520/0001-07.\r\n\r\nSob uma administração moderna, arrojada e em consonância com as tendências do segmento, mantendo a confiança, respeitabilidade e tradição adquiridas, a Real Ladrilhos vem produzindo ladrilhos pelo método hidráulico de fabricação, provendo o mercado de variados tipos e modelos.\r\n\r\nCom muita dedicação e cuidado na manufatura artesanal das peças, essa técnica foi passada de geração em geração mantendo-se intacta através dos anos e agora aproveitada na produção da Real Ladrilhos, sob a constante vigilância de seu fundador.\r\n\r\nTodos os minuciosos detalhes desde o preparo da matéria prima até a execução das peças seguem rigoroso processo de seleção e qualidade, alcançando um resultado surpreendente nos ladrilhos produzidos, com o objetivo de alcançar valores reconhecidos pelos consumidores quer seja em termos de durabilidade, em beleza, em simetria de forma a compor a melhor opção nas decorações onde o emprego deste material se faça.\r\n\r\nColocamos à sua disposição uma grande variedade de desenhos e cores a fim de dar um toque totalmente personalizado ao seu projeto de forma a propiciar a nossos clientes consumidores um status diferenciado perante a quem os visitar.\r\n\r\nPara tanto, nossa empresa oferece bom gosto, elegância, tradição, qualidade, exclusividade, presteza, atendimento em curto espaço de tempo e uma política de transparência e respeito ao mercado consumidor por práticas como por exemplo preço justo aplicado a nossos serviços e produtos.\r\n\r\nEntre em contato conosco, visite nosso show room e conheça mais sobre os ladrilhos hidráulicos artesanais por nós fabricados.', 'logo.jpg', 'logo.jpeg', NULL, NULL, NULL, NULL, 'Período de avaliação', NULL, NULL, NULL, '2018-05-28 10:28:58', NULL, 1773, 8, NULL, NULL, NULL, NULL, NULL, NULL, 'Vendas@realladrilhos.com.br'),
